import React, { useEffect, useState } from 'react';
import { getMOLs, removeMOLs } from '../services/api';
import Header from '../components/shared/Header';
import { Table, TableContainer, TableHead, TableRow, TableCell, TableBody, Paper, Button } from '@mui/material';

const MOL = () => {
    const [mols, setMOLs] = useState([]);

    useEffect(() => {
        getMOLs(setMOLs)
    }, []);

    useEffect(() => {
        console.log(mols)
    }, [mols])

    return (
        <>
            <Header heading="МОЛ" />
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>ФИО</TableCell>
                            <TableCell>Должность</TableCell>
                            <TableCell>Отдел</TableCell>
                            <TableCell>Действия</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {mols.map((row) => (
                            <TableRow
                                key={row.id}
                                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                            >
                                <TableCell>{row.фио_мол}</TableCell>
                                <TableCell>{row.должность}</TableCell>
                                <TableCell>{row.название_подразделения}</TableCell>
                                <TableCell>
                                    <Button onClick={() => removeMOLs(row.id)}>Удалить</Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </>
    );
};

export default MOL;
